import React, { useState, useMemo } from 'react';
import { Button } from '../../components/Button';

export const Login = () => {
    const [emailValue, setEmailValue] = useState('');
    const [passwordValue, setPasswordValue] = useState('');

    const emailHandler = (event: any) => {
        setEmailValue(event.target.value);
    };

    const passwordHandler = (event: any) => {
        setPasswordValue(event.target.value);
    };

    const saveDataInput = () => {
        const inputValue = {
            email: emailValue,
            password: passwordValue,
        };
        console.log(inputValue);
    };

    return (
        <div className="flex items-center justify-center ">
            <div className="flex flex-col justify-center items-start rounded-2xl border-2 border-neutral-300 w-2/5 m-40 p-8 shadow-xl">
                {/*max-2xl:flex-col */}
                <div className="flex items-center w-full ">
                    <p className="items-center text-2xl font-medium p-5 bg-slate-400">
                        Sign In
                    </p>
                </div>

                <label className="flex items-start">Email adress</label>
                <input
                    placeholder="Enter email"
                    className="rounded-xl border-2 border-neutral-300 p-1 mb-2 w-full"
                    onChange={emailHandler}
                ></input>
                <label>Password</label>
                <input
                    placeholder="Password"
                    className="rounded-xl border-2 border-neutral-300 p-1 "
                    onChange={passwordHandler}
                ></input>
                <div className="w-max bg-slate-500">
                    {/*<button
                        className="bg-indigo-600 text-white w-full rounded-xl p-1 m-2"
                        onClick={saveDataInput}
                    >
                        Submit
                    </button>*/}

                    <Button
                        content={'Submit'}
                        background="bg-indigo-600"
                        onClick={saveDataInput}
                    />
                </div>
                <p>
                    Forgot{' '}
                    <a
                        className="text-blue-400 underline"
                        placeholder="password?"
                    ></a>
                </p>
            </div>
        </div>
    );
};
